import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Accordion from '@material-ui/core/Accordion';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
    },
    heading: {
        fontSize: theme.typography.pxToRem(15),
        flexBasis: '33.33%',
        flexShrink: 0,
    },
    secondaryHeading: {
        fontSize: theme.typography.pxToRem(15),
        color: theme.palette.text.secondary,
    },
}));

const ExperienceStudies = () => {
    const classes = useStyles();
    const [expanded, setExpanded] = React.useState(false);

    const handleChange = (panel) => (event, isExpanded) => {
        setExpanded(isExpanded ? panel : false);
    };
    return (
        <div className={classes.root}>
            <Accordion expanded={expanded === 'panel1'} onChange={handleChange('panel1')}>
                <AccordionSummary
                    expandIcon={<ExpandMoreIcon />}
                    aria-controls="panel1bh-content"
                    id="panel1bh-header"
                >
                    <Typography className={classes.heading}>LinkedIn Learning</Typography>
                    <Typography className={classes.secondaryHeading}>Övriga professionella kurser</Typography>
                </AccordionSummary>
                <AccordionDetails>
                    <Typography>
                        <ul>
                            <li>Agile Development Practices</li>
                            <li>CSS Essential Training 3</li>
                            <li>CSS Essential Training 2</li>
                            <li>CSS Essential Training 1</li>
                            <li>HTML Essential Training</li>
                            <li>Programming Foundations: Fundamentals</li>
                            <li>UX Foundations: Accessibility</li>
                            <li>User Experience for Web Designers</li>
                            <li>HTML & CSS: Creating Forms</li>
                            <li>Web Development Foundations: Full-Stack vs Front-End</li>
                            <li>Ionic 2 and AngularFire2: Building Mobile Apps</li>
                            <li>Cirkelledare - ABF</li>
                            <li>JavaScript and JSON</li>
                            <li>Up and Running with AngularJS 1</li>
                            <li>Bootstrap 3: Advanced Web Development</li>
                            <li>WordPress Developer Tips: Information Architecture and the Template Hierarchy</li>
                        </ul>
                    </Typography>
                </AccordionDetails>
            </Accordion>
            <Accordion expanded={expanded === 'panel2'} onChange={handleChange('panel2')}>
                <AccordionSummary
                    expandIcon={<ExpandMoreIcon />}
                    aria-controls="panel2bh-content"
                    id="panel2bh-header"
                >
                    <Typography className={classes.heading}>Google Analytics / Google Adwords</Typography>
                    <Typography className={classes.secondaryHeading}>
                        2 dagars kurs från Google
          </Typography>
                </AccordionSummary>
                <AccordionDetails>
                    <Typography>
                        Google Analytics del 1 +2 Introduktions- samt fördjupningskurs av Outfox/Google, Januari 2015.<br />
                    AdWords Advertising Fundamentals, en tredagars kurs hos Google, Mars, 2015.
          </Typography>
                </AccordionDetails>
            </Accordion>
            <Accordion expanded={expanded === 'panel3'} onChange={handleChange('panel3')}>
                <AccordionSummary
                    expandIcon={<ExpandMoreIcon />}
                    aria-controls="panel3bh-content"
                    id="panel3bh-header"
                >
                    <Typography className={classes.heading}>Advanced settings</Typography>
                    <Typography className={classes.secondaryHeading}>
                        Filtering has been entirely disabled for whole web server
          </Typography>
                </AccordionSummary>
                <AccordionDetails>
                    <Typography>
                        Nunc vitae orci ultricies, auctor nunc in, volutpat nisl. Integer sit amet egestas eros,
                        vitae egestas augue. Duis vel est augue.
          </Typography>
                </AccordionDetails>
            </Accordion>

        </div>
    );
};

export default ExperienceStudies;
